import Header from './Header'
import Content from './Content'

const Course = (props) => {
    const course = props.course.parts
    return (
        <div>
            <Header name='Half Stack Application Development' />
            <Content course={course} />
            {course.map(a => {
                return (
                    <div>
                        {a.name} {a.exercises}
                    </div>
                )
            })}
        </div>
    )
}

export default Course
